import React from 'react';

//comps
import Introduction from './components/Introduction';
import Projects from './components/Projects';
import Contact from './components/Contact';
import Footer from './components/Footer';

import './App.css';

function App() {
  return (
    <div className="App">
      <Introduction/>
      <Projects/>
      <Contact/>
      <Footer/>
    </div>
  );
}

export default App;
